    fetch("https://swapi.dev/api/films/")
      .then((resp) => resp.json())
      .then((data) => console.log(data.results));
  }

  function onClickHandler() {}

  return (
    <React.Fragment>
      <section>
        <button onClick={fetchMoviesHandler}>Fetch Movies</button>
      </section>
      <section>{/* <MoviesList movies={dummyMovies} /> */}</section>
    </React.Fragment>
  );
}

export default App;
